package com.example.lesson2_androidapp;

import androidx.appcompat.app.AppCompatActivity;

import android.media.Image;
import android.os.Bundle;
import android.view.View;
import android.widget.Button;
import android.widget.ImageView;
import android.widget.Toast;

import com.squareup.picasso.Picasso;

import java.util.ArrayList;
import java.util.List;
import java.util.Random;

public class MainActivity extends AppCompatActivity {

    private static List<String> images = new ArrayList<>();

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        Button button = this.findViewById((R.id.button1));

        final ImageView imageView = this.findViewById(R.id.imageView1);


        button.setOnClickListener(
                new View.OnClickListener() {
                    @Override
                    public void onClick(View v) {
                        Toast.makeText(MainActivity.this,"Loading image...", Toast.LENGTH_SHORT).show();


                        Picasso.get().load(getRandomPicture()).into(imageView);

                    }
                }


        );

    }

    static {
        images.add("https://i.imgur.com/DvpvklR.png");
        images.add("data:image/webp;base64,");
        images.add("data:image/jpeg;base64,");
        images.add("https://www.sport24.gr/img/6675/10272265/399000/we1200/1200/diamantidis-tsartsaris.jpg");
    }
    private static String getRandomPicture(){
        Random r = new Random();
        return images.get(r.nextInt(images.size()));
    }
}